contracts/RealEstate.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

contract RealEstate {
    uint public propertyCount = 0;

    enum Status { Available, Rented }

    struct Property {
        uint id;
        string name;
        string location;
        address payable owner;
        address renter;
        uint rentPrice;
        Status status;
    }

    mapping(uint => Property) public properties;

    // Thêm tài sản mới
    function addProperty(string memory _name, string memory _location, uint _rentPrice) public {
        propertyCount++;
        properties[propertyCount] = Property({
            id: propertyCount,
            name: _name,
            location: _location,
            owner: payable(msg.sender),
            renter: address(0),
            rentPrice: _rentPrice,
            status: Status.Available
        });
    }

    // Thuê tài sản
    function rentProperty(uint _propertyId) public payable {
        Property storage prop = properties[_propertyId];
        require(prop.status == Status.Available, "Property is not available");
        require(msg.value >= prop.rentPrice, "Insufficient rent payment");

        prop.renter = msg.sender;
        prop.status = Status.Rented;
        prop.owner.transfer(msg.value);
    }

    // Kết thúc hợp đồng thuê
    function endRental(uint _propertyId) public {
        Property storage prop = properties[_propertyId];
        require(msg.sender == prop.owner || msg.sender == prop.renter, "Not authorized");
        require(prop.status == Status.Rented, "Property is not rented");

        prop.renter = address(0);
        prop.status = Status.Available;
    }

    // Xem chi tiết tài sản
    function getProperty(uint _propertyId) public view returns (
        uint, string memory, string memory, address, address, uint, Status
    ) {
        Property memory prop = properties[_propertyId];
        return (
            prop.id,
            prop.name,
            prop.location,
            prop.owner,
            prop.renter,
            prop.rentPrice,
            prop.status
        );
    }
}

